import styled from "styled-components";

export const TableContainer = styled.div`
        display: -webkit-box;
    display: -webkit-flex;
    display: -ms-flexbox;
    display: flex;
    flex-direction: column;
    align-content: stretch;
    align-items: flex-start;
`
